import React from 'react';
import { Layout as AntLayout, Menu, Card } from 'antd';

const { Header, Content, Footer } = AntLayout;

const MyLayout = () => {
    // Definim o listă de conținut pentru carduri
    const cardContent = [
        { title: 'Card 1', content: 'Conținutul cardului 1' },
        { title: 'Card 2', content: 'Conținutul cardului 2' },
        { title: 'Card 3', content: 'Conținutul cardului 3' }
    ];

    return (
        <AntLayout>
            <Header>
                <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['1']}>
                    <Menu.Item key="1">Acasă</Menu.Item>
                    <Menu.Item key="2">Despre</Menu.Item>
                    <Menu.Item key="3">Contact</Menu.Item>
                </Menu>
            </Header>
            <Content style={{ padding: '0 50px' }}>
                <div className="site-layout-content">
                    <h2>Listă de Carduri</h2>
                    <div style={{ display: 'flex', justifyContent: 'space-between' }}>
                        {cardContent.map((card, index) => (
                            <Card key={index} title={card.title} style={{ width: 300, marginBottom: 20 }}>
                                {card.content}
                            </Card>
                        ))}
                    </div>
                </div>
            </Content>
            <Footer style={{ textAlign: 'center' }}>
                Contact: contact@exemplu.com | Telefon: +1234567890
            </Footer>
        </AntLayout>
    );
};

export default MyLayout;
